import React from 'react';

import BotaoGol from './BotaoGol'

export default function Time(props){
  return(
    <div>
      <h1>{props.nome}</h1>
      <h2>{props.gols}</h2>
      <BotaoGol marcarGol={props.marcarGol}/>
    </div>
  )
}
